    const style = {
        nav: 'bg-gray-800 h-20 flex items-center p-4 flex justify-between',
        heading: 'text-white text-3xl'
    }

  return (
    <div className={style.nav}>
        <h1 className={style.heading}>Chat App</h1>

        <SignIn/>
        <LogOut/>
    </div>
  )
}

export default Navbar
